    AccumxOES::load_with(loadfn);
    ActiveProgramEXT::load_with(loadfn);
    ActiveShaderProgram::load_with(loadfn);
    ActiveShaderProgramEXT::load_with(loadfn);
    ActiveStencilFaceEXT::load_with(loadfn);
    ActiveTexture::load_with(loadfn);
    ActiveTextureARB::load_with(loadfn);
    ActiveVaryingNV::load_with(loadfn);
    AlphaFragmentOp1ATI::load_with(loadfn);
    AlphaFragmentOp2ATI::load_with(loadfn);
    AlphaFragmentOp3ATI::load_with(loadfn);
    AlphaFunc::load_with(loadfn);
    AlphaFuncQCOM::load_with(loadfn);
    AlphaFuncx::load_with(loadfn);
    AlphaFuncxOES::load_with(loadfn);
    ApplyTextureEXT::load_with(loadfn);
    AreProgramsResidentNV::load_with(loadfn);
    AreTexturesResident::load_with(loadfn);
    AreTexturesResidentEXT::load_with(loadfn);
    ArrayElement::load_with(loadfn);
    ArrayElementEXT::load_with(loadfn);
    ArrayObjectATI::load_with(loadfn);
